namespace Image{

// CLASSES !!!

    class Size{
    public:
        Size(){}
        Size(int h, int w){ H=h, W=w; }
        Size(const Size &s){ H=s.H, W=s.W; }
        bool operator>=(const Size &s){ return (H >= s.H) && (W >= s.W); }
        bool operator==(const Size &s)const{ return (H == s.H) && (W == s.W); }
        int H, W;
    };

    class Place{
    public:
        Place(){ I=0, J=0; }
        Place(int i, int j){ I=i, J=j; }
        Place(const Place &p){ I=p.I, J=p.J; }
        bool operator==(const Place &pl){ return (I == pl.I) && (J == pl.J); }
        int I, J;
    };

    //define
    bool srand();

    class Alphabet {
    private:
        static const int intBits = 32;

        static const int letMinW = 1;
        static const int letMinH = 5;

        static const int letMaxW = 27;
        static const int letMaxH = 22;

        static const int nFStyle = 2;
        static const int nFSize = 21;
        static const int nLetter = 26;

    public:

        class Letter{
        public:
            Letter(Place pl, const Size &s, const char row[letMaxH][letMaxW+1]):s(s),row(row){ this->pl = pl; }
            bool operator==(const Letter &l){ return (pl == l.pl) && (l.s == s);}
            Place pl;
            const Size &s;
            const char (*row)[letMaxW+1];
        };

        typedef std::vector<std::string> vec_string;
        typedef std::vector<bool> vec_bool;
        typedef std::list<Alphabet::Letter> list_letter;
        typedef std::vector<unsigned int> vec_uint;
        typedef std::list<Alphabet::Letter*> list_letter_ptr;

        static list_letter findByRealising(const vec_string &image, const vec_bool &opened, int nb, int nLetter);

    private:

        static unsigned int rowStrToUnInt(const std::string &row){
          unsigned int result = 0;
          for(int i = 0; i < row.length(); i++){
            // if row[i] == 1 (compare numbers)
            if(row[i] == '1'){
              result >>= intBits-i-1;
              result++;
              result <<= intBits-i-1;
            }
          }
          return result;
        }

        static const unsigned int letRowUnInt[nFStyle][nFSize][nLetter][letMaxH];
        static const char letRowFill[nFStyle][nFSize][nLetter][letMaxH][letMaxW+1];
        static const Size letSize[nFStyle][nFSize][nLetter];

    };

// FUNCTIONS !!!

    typedef std::vector<std::string> vec_string;

    bool srand();
    void init(vec_string &im, const Size &s);
    int countFill(vec_string &im);
    void drawLetter(vec_string &im, Alphabet::Letter &let);
    void output(vec_string &im, std::string fname);
}


