const int Alphabet::intBits;

const int Alphabet::letMinW;
const int Alphabet::letMinH;

const int Alphabet::letMaxW;
const int Alphabet::letMaxH;

const int Alphabet::nFStyle;
const int Alphabet::nFSize;
const int Alphabet::nLetter;

Alphabet::list_letter Image::Alphabet::findByRealising(const vec_string &im, const vec_bool &opened, int nb, int nLetter){
  list_letter result;

  int H = im.size(),
      W = im[0].length();

  int ind = 0;
  std::vector<std::vector<int> > imFillInd(H);
  for(int i = 0; i < H; i++){
    imFillInd[i].resize(W,-1);
    for(int j = 0; j < W; j++)
      if(opened[i] && im[i][j] == '1') imFillInd[i][j] = ind++;
  }

  typedef Letter letter;
  typedef std::pair<int,letter> p_int_let;
  // first - fill count, second - letters
  std::vector<std::pair<int,std::list<p_int_let*> > > letFill(ind);
  std::list<p_int_let> letContainer;

  for(int sz = nFSize-1; sz >= 0; sz--){
    vec_uint column(H,0);
    for(int i = 0; i < H; i++){
      std::string str = im[i].substr(0,letMaxW);
      column[i] = rowStrToUnInt(str);
    }
    for(int j = 0; j < W-letMinW+1; j++){
      for(int i = 0; i < H-letMinH+1; i++){
        for(int st = nFStyle-1; st >= 0; st--)
          for(int let = 0; let < Image::Alphabet::nLetter; let++){
            const Size &s = letSize[st][sz][let];
            // is letter with good height
            if((H-i >= s.H) && (W-j >= s.W)){
              const unsigned int *row = letRowUnInt[st][sz][let];
              bool is = 1;
              for(int k = 0; k < s.H ; k++){
                if(opened[i+k] && ((column[i+k]&row[k]) != row[k])){
                  is = 0;
                  break;
                }
              }
              if(is){
                const char (*row)[28] = letRowFill[st][sz][let];
                int r = 0;
                for(int k = 0; k < s.H ; k++)
                  if(opened[i+k]) r += row[k][0];

                if(r != 0){
                  bool first = 0;
                  for(int k = 0; k < s.H ; k++)
                    if(opened[i+k])
                      for(int q = 1; q <= row[k][0]; q++){
                        if(letFill[imFillInd[i+k][j+row[k][q]]].second.empty()){
                          letFill[imFillInd[i+k][j+row[k][q]]].first = r;
                        }else if(letFill[imFillInd[i+k][j+row[k][q]]].first < r){
                          letFill[imFillInd[i+k][j+row[k][q]]].first = r;
                          for(std::list<p_int_let*>::iterator it = letFill[imFillInd[i+k][j+row[k][q]]].second.begin();
                              it != letFill[imFillInd[i+k][j+row[k][q]]].second.end(); it++) (*it)->first--;
                          letFill[imFillInd[i+k][j+row[k][q]]].second.clear();
                        }

                        if(letFill[imFillInd[i+k][j+row[k][q]]].first == r){
                          if(!first){
                            letContainer.push_back(p_int_let(0,Letter(Place(i,j),s,letRowFill[st][sz][let])));
                            first = 1;
                          }
                          letContainer.back().first++;
                          letFill[imFillInd[i+k][j+row[k][q]]].second.push_back(&letContainer.back());
                        }
                      }
                }
              }
            }
          }
      }
      for(int i = 0; i < H; i++){
        column[i] <<= 1;
        if(j+letMaxW < W){
          column[i] >>= intBits-letMaxW;
          if(im[i][j+letMaxW] == '1') column[i]++;
          column[i] <<= intBits-letMaxW;
        }
      }
    }
  }

  while(!letContainer.empty()){
    if(letContainer.back().first > 2) result.push_back(letContainer.back().second);
    letContainer.pop_back();
  }


  return result;
}


