bool Image::srand(){
  static bool go = 0;
  if(!go){
    std::srand(time(NULL));
    go = 1;
  }
  return go;
}

void Image::init(vec_string &im, const Size &s){
  im.resize(s.H);
  for(int i = 0; i < s.H; i++) im[i].resize(s.W,'0');
}

int Image::countFill(vec_string &im){
  int h = im.size(),
      w = im[0].length();
  int res = 0;
  for(int i = 0; i < h; i++)
    for(int j = 0; j < w; j++)
      if(im[i][j] == '1') res++;
  return res;
}

void Image::drawLetter(vec_string &im, Alphabet::Letter &let){
  for(int i = 0; i < let.s.H; i++)
    for(int j = 1; j <= let.row[i][0]; j++){
      im[let.pl.I+i][let.pl.J+let.row[i][j]] = '1';
    }
}

void Image::output(vec_string &image, std::string fname){
  std::ofstream out(fname.c_str(),std::ofstream::out);

  out << "height = " << image.size() << "\n";
  out << "width = " << image[0].length() << "\n";
  out << "nb = " << countFill(image) << "\n";
  for(int i = 0; i < image.size(); i++) out << image[i] << "\n";
}


